import React from "react";

export default function Seven() {
  return (
    <div>
      {/*Acceuil */}
      <div className="flex w-full mt-32">
        <div className="text-7xl w-1/2 pl-2 flex justify-start ">
          Caarrières Chez
          <br />
          Caauri
        </div>
        <div className="w-1/2 text-2xl font-medium mt-20 pl-16 flex justify-center">
          Appel à tous les acteurs du changement
          <br />
          Caauri recrute !
        </div>
      </div>
      {/* Section recrutement */}
      <div>
        <div className="flex justify-center items-center flex-col mt-32 space-y-2">
          <span className="text-2xl font-medium">Nous embauchons</span>
          <span>
            <img src="/icon/arrow_circle.svg" alt="" className="h-7 w-7" />
          </span>
           {/* Carreer */}
        </div>
      </div>
    </div>
  );
}
